var tipuesearch = {"pages": [{'title': '更新Python 3.8.2', 'text': '1.進入\xa0 https://www.python.org/downloads/release/python-382/ \n 2.下載 Windows x86-64 executable installer \n 3.下載完成後開啟，選擇Customize installation選項 \n \n 4.不要勾選pip選項，接著按下next \n \n 5.選擇路徑將python安裝至可攜式系統中的Y槽下 \n 6.接著開啟start_mdecourse.bat批次檔 \n 7.將 start_mdecourse.bat批次檔中的py373改為安裝python 3.8.2版本的資料夾 \n 8.將安裝的版本資料夾取名為py382 \n \n 8.執行stop.bat批次檔後重新啟動start_mdecourse(為了讓檔案重新讀取) \n 9.輸入get-pip.py，開始安裝pip工具 \n 10.安裝cmsimde所需模組 \n \n 11.版本已更新至  python 3.8.2 \n \n', 'tags': '', 'url': '更新Python 3.8.2.html'}, {'title': 'webots tutorial', 'text': '', 'tags': '', 'url': 'webots tutorial.html'}, {'title': 'webots 入門', 'text': '', 'tags': '', 'url': 'webots 入門.html'}, {'title': '用戶介面', 'text': 'Webots GUI由四個主要窗口組成：顯示並允許您與3D模擬進行交互的 3D窗口 ，表示當前世界的層次結構的“\xa0 場景樹” ，允許您編輯源代碼的“\xa0 文本”編輯器 ，以及最後，同時顯示編譯和控制器輸出的 控制台 。 \n \n GUI有九個菜單 \n File, Edit, View, Simulation, Build, Overlays, Tools, Wizards 和 Help 。 \n 文件菜單 \n 文件 菜單允許您執行常規的文件操作：加載，保存等。 \n \n \n 所述 新世界 菜單項目（和按鈕）中只含有模擬窗打開一個新的世界 ElevationGrid ，顯示為10×10平方1米×1米的表面上的棋盤。 \n \n \n “ \xa0 打開世界...” 菜單項（和按鈕）打開一個文件選擇對話框，該對話框允許您選擇要加載的“ .wbt”文件。 \n \n \n 通過“ \xa0 打開最近的世界” 菜單項，可以從子菜單中顯示的列表中選擇一個最近打開的“ .wbt”文件，以重新打開該文件。 \n \n \n “ \xa0 打開示例世界” 菜單項將打開一個對話框，列出所有可用的示例世界，在其中可以通過在搜索字段中輸入文件名或其中的一部分來搜索要加載的特定“ .wbt”文件。 \n \n \n “ \xa0 保存世界” 菜單項（和按鈕）使用當前文件名（顯示在主窗口頂部的文件名）保存當前世界。 在每個 Save .wbt文件的內容上都將被覆蓋，Webots不會創建任何備份副本，因此，您應謹慎使用此按鈕，並最終手動進行安全副本。 \n \n \n “ \xa0 另存為...” 菜單項（和按鈕）使用用戶輸入的新文件名保存當前世界。 請注意，“。wbt”文件應始終保存在Webots項目目錄以及“ worlds”子目錄中，否則將無法重新打開該文件。 \n \n \n “ \xa0 重新加載世界” 菜單項（和按鈕）從已保存的版本重新加載當前世界，並從頭開始重新進行仿真。 \n \n \n \xa0述 復位仿真 菜單項目（和按鈕）恢復模擬的初始狀態。 仿真並沒有像重新加載一樣完全被破壞和重建，但是所有節點的初始狀態都得以恢復，這要快得多。 \n \n \n \xa0 \xa0 \xa0 \xa0 “ \xa0 新建文本文件” 菜單項（和按鈕）在文本編輯器中打開一個空文本文件。 \n \n \n “ \xa0 打開文本文件...” 菜單項（和按鈕）打開一個文件選擇對話框，該對話框允許您選擇要加載的文本文件（例如“ .java”文件）。 \n \n \n “ \xa0 保存文本文件” 菜單項（和按鈕）將保存當前文本文件。 \n \n \n “ \xa0 將文本文件另存為...” 菜單項（和按鈕）使用用戶輸入的新文件名保存當前文本文件。 \n \n \n 將 保存所有文本文件 菜單項保存所有打開的和未保存的文本文件。 \n \n \n “ \xa0 還原文本文件” 菜單項（和按鈕）從保存的版本中重新加載文本文件。 \n \n \n “ \xa0 打印預覽...” 菜單項打開一個窗口，可讓您管理頁面佈局，以便從文本編輯器中打印文件。 \n \n \n “ \xa0 打印...” 菜單項打開一個窗口，使您可以打印文本編輯器的當前文件。 \n \n \n 在 導入VRML97 ... 菜單項，在現場樹的末尾添加VRML97對象。這些對象來自您必須指定的VRML97文件。此功能對於導入在3D建模程序中建模的複雜形狀，然後導出到VRML97（以前稱為VRML 2.0）非常有用。大多數3D建模軟件，例如3D Studio Max，Maya，AutoCAD，Pro Engineer，AC3D或Art Of Illusion，都包含VRML97（或VRML 2.0）導出功能。請注意，Webots無法以VRML 1.0格式導入文件。導入後，這些對象將在場景樹的底部顯示為 Group ， Transform 或 Shape 節點。然後，您可以將這些對象轉換為Webots節點（例如 Solid ， Robot 等），或將它們剪切並粘貼到 children 現有Webots節點列表中。 \n \n \n 該 出口VRML97 ... 項目讓您當前載入世界保存為“.WRL”的文件，符合VRML97標準。反過來，可以使用任何VRML97查看器和大多數3D建模軟件打開此類文件。 \n \n \n 使用 “截取屏幕截圖...” 項可以截取Webots中當前視圖的截屏。它會打開一個文件對話框，將當前視圖另存為PNG或JPG圖像。 \n \n \n 在 製作電影... 項允許你創建MPEG電影（Linux和MacOS）或AVI動畫（Windows）中。電影錄製開始後，將在中更改此項 Stop Movie... 。在錄製期間，可以更改運行模式並暫停模擬。但是，僅在Webots步驟期間捕獲幀，而在暫停模擬時不捕獲。除了選擇影片的分辨率和壓縮質量外，還可以通過設置動畫來以加速模式或慢動作記錄模擬。 Video acceleration 彈出對話框中的值。如果視頻加速度值小於1，則錄製的動畫將比模擬慢。最大減慢速度，即最小加速度值，是由模擬的基本時間步長定義的，因為不可能以比模擬更新率更高的幀率進行記錄。為了增加最大的減慢速度，您應該減少仿真的基本時間步長。選中視頻字幕選項將在電影的右上角顯示加速度值。 \n \n “ \xa0 導出HTML5模型...” 項允許您將當前世界導出為交互式3D“ .html”文件。 您可以在 本節中 獲得有關此主題的更多信息 。 \n \n “ \xa0 製作HTML5動畫...” 項使您可以將模擬記錄為3D動畫並將其發佈在HTML5網頁上。 開始動畫錄製後，此項目將更改為 Stop HTML5 Animation... ，可用於停止動畫錄製。 您可以在 本節中 獲得有關此主題的更多信息 。 \n \n \n 退出將 終止當前的模擬並關閉Webot。 \n \n \n \n \n 編輯菜單 \n 編輯菜單提供了常用的文本編輯功能，可操縱在“\xa0 文本”編輯器中 打開的 文件 ，例如“複製”，“粘貼”，“剪切”等。 \n \n 查看菜單 \n 使用“ \xa0 查看” 菜單可以控制模擬窗口中的查看。 \n \n \n 的 跟隨對象 子菜單可固定的（靜態）視點和跟隨移動對象（通常是一個機器人）的視點之間切換。 如果希望視點跟隨對象，則首先需要用鼠標選擇對象，然後根據所需的以下行為檢查子菜單中的一項。 有關不同以下行為的更多信息， 請參考 Viewpoint 文檔。 \n \n \n 加載或還原文件後， “ \xa0 還原 視點” 項會將視點的位置和方向恢復為其初始設置。 當您在場景中導航時迷路並想要返回原始視點時，此功能非常方便。 \n \n \n \xa0 將視點移至對象 會將視點移至中心並在選定節點上縮放。 如果所選項目是字段，則將定位上級父節點。 該對象將位於3D視圖的中心，並且將完全可見。 \n \n \n 在 更改視圖 子菜單移動視點對準它在任何所選擇的對象周圍的世界六大對齊軸。 如果未選擇任何對象，則視點將以世界原點為中心。 可用的選項為 \xa0 前視圖 ， \xa0 後視圖 ， \xa0 左視圖 ， \xa0 右視圖 ， \xa0 頂視圖 和 \xa0 底視圖 。 \n \n \n “ \xa0 全屏” 項啟用和禁用在整個屏幕上顯示3D窗口。 \n \n \n 該 虛擬現實耳機 子菜單允許你使用虛擬現實的耳機，如HTC萬歲或Oculus Rift以查看模擬： \n \n 將 啟用 選項允許你切換模擬視圖耳機。 \n “ \xa0 跟踪頭戴式耳機位置” 和“ \xa0 跟踪頭戴式耳機方向” 項目指定是否應跟踪頭戴式耳機的位置和方向並將其應用於視點。 \n “ \xa0 查看左眼” ，“ \xa0 查看右眼” 和“ \xa0 空視圖” 單選按鈕使您可以選擇在模擬視圖中應顯示的內容。 您可以看到左眼圖像，右眼圖像或什麼都看不到。 \n 使用“ \xa0 抗鋸齒” 項可以在兩隻眼睛的圖像上啟用抗鋸齒（請注意，抗鋸齒會降低仿真速度）。 \n 此處 介紹耳機的安裝過程 。 \n \n 通過“ \xa0 投影” 單選按鈕組，可以在“ \xa0 透視投影” （默認）和“ \xa0 Webots模擬”窗口的“ \xa0 正投影” 模式 之間進行選擇 。 該 透視 模式對應於天然投影：其中所述更遠的對象是從觀察者，較小它出現在圖像中。 使用 正交 投影時，與查看者的距離不會影響物體的大小。 此外，在 正交 模式下，模型中平行的線在屏幕上平行繪製，因此，此投影有時在建模階段很有用。 在 正交 模式下 不會渲染陰影 。 \n \n “ \xa0 渲染” 單選按鈕組使您可以在“ \xa0 普通渲染” （默認）和“ \xa0 Webots模擬” \xa0 的“ \xa0 線框” 模式 之間進行選擇 。 在 普通渲染 模式下，對像以其幾何面，材質，顏色和紋理進行渲染，其方式與通常用眼睛或照相機看到的方式相同。 在 線框渲染 模式下，只有可呈現圖元的段被渲染。 此模式對於調試網格很有用。 如果 線框渲染 模式和 View / Optional Rendering / Show All Bounding Objects 切換按鈕均被激活，則僅繪製邊界對象（不渲染可渲染圖元）。 這可用於調試衝突檢測問題。 \n \n \n 在 可選的渲染 子菜單，可以顯示或隱藏，補充信息。 這些渲染僅顯示在主渲染中，並隱藏在機器人攝像機中。 它們用於更好地了解模擬的行為： \n \n \n 使用“ \xa0 顯示坐標系”， 可以將3D窗口右下角的全局坐標系顯示或隱藏為分別代表x，y和z軸的紅色，綠色和藍色箭頭。 \n \n \n 使用“ \xa0 顯示所有邊界對象”， 可以顯示或隱藏所有邊界對象（在 每個 Solid 節點 的 boundingObject 字段中 定義 ）。 邊界對象由白線表示。 當發生碰撞時，這些線變為玫瑰，而當實體處於空閒狀態（即，它靜止不與任何其他活動的實體相互作用）時，這些線變為藍色。 \n \n \n “ \xa0 顯示接觸點” 使您可以顯示或隱藏由碰撞檢測引擎生成的接觸點。 沒有示出沒有產生相應的接觸力的接觸點。 接觸力僅對使用物理模擬的對像生成（ 需要 物理 節點）。 需要考慮此操作的步驟。 \n \n \n 使用 顯示連接器軸 可以顯示或隱藏連接器軸。 旋轉對齊方式顯示為黑色，而y和z軸分別顯示為綠色和藍色。 \n \n \n 使用“ \xa0 顯示關節軸” 可以顯示或隱藏關節軸。 關節軸用黑線表示。 \n \n \n 所述 顯示測距儀平截頭體 ，可以顯示或隱藏，OpenGL的平截頭體剔除和場景中的每個測距儀所記錄的圖像，使用黃色線框。 如果測距儀設備被禁用或第一張圖像尚不可用，則視錐將以灰色繪製。 OpenGL剔除視錐是與測距儀視場相對應的截頂金字塔。 記錄的圖像顯示在視錐台所描述的平面上，其距離對應於距設備中心的測距儀的最小範圍。 有關此概念的更多信息，請參見OpenGL文檔。 \n \n \n 使用“ \xa0 顯示激光雷達路徑” ，您可以使用青色線框顯示或隱藏場景中每個激光雷達的圖層（激光射線路徑）。 如果禁用了激光雷達設備或尚無法進行第一次測量，則將這些層繪製為灰色。 \n \n \n 該 展會激光雷達點雲 ，可以顯示或隱藏，對於每一個激光雷達點雲點雲模式下啟用的場景。 點雲由這些點本身的位置以及從激光雷達原點到這些點的光線（從藍色（頂層）到紅色（底層）的漸變）表示。 這種可選的渲染在計算上很昂貴，因此會大大降低仿真速度。 請注意，如果點雲包含超過2500個點，則不會顯示從激光雷達原點到該點的射線。 \n \n \n “ \xa0 顯示攝像機視錐” 允許您使用洋紅色線框顯示或隱藏場景中每個攝像機的OpenGL消隱視錐和記錄的圖像。 如果禁用了相機設備或第一張圖像尚不可用，則視錐將以灰色繪製。 OpenGL剔除視錐是與攝像機視場相對應的截頂金字塔。 由於遠端平面設置為無窮大，因此未顯示金字塔的背面。 記錄的圖像顯示在相機的近平面上。 有關此概念的更多信息，請參見OpenGL文檔。 \n \n \n 所述 顯示DistanceSensor射線 ，可以顯示或隱藏，光線由距離傳感器設備鑄造。 這些光線繪製為紅線（在碰撞點之外變為綠色）。 它們的長度對應於設備的最大範圍。 如果距離傳感器設備被禁用或尚無法進行第一次測量，則光線將以灰色繪製。 \n \n \n 所述 顯示LightSensor射線 ，可以顯示或隱藏，光線鑄造由光傳感器裝置。 這些射線繪製為黃線。 如果禁用了光傳感器設備或尚無法進行第一次測量，則光線將以灰色繪製。 \n \n \n “ \xa0 顯示光位置” 允許您顯示或隱藏 PointLight 和 SpotLight 燈 的位置 。 \xa0 沒有顯示 DirectionalLight 節點。 \xa0 PointLight 和 SpotLight 節點由被耀斑圍繞的彩色圓圈表示。 \n \n \n “ \xa0 顯示筆繪畫射線” 使您可以顯示或隱藏筆設備繪畫的射線。 如果啟用繪畫，這些光線將繪製為紫線，否則繪製為灰線。 \n \n \n “ \xa0 顯示雷達視錐” 允許您顯示或隱藏雷達視錐。 如果啟用了雷達設備，則視錐表將顯示為藍色，否則，如果禁用了雷達或尚無法進行首次測量，則視錐表將顯示為灰色。 雷達視錐表代表雷達可以在其中檢測目標的體積。 \n \n \n “ \xa0 顯示重心” 使您可以顯示或隱藏具有非NULL \xa0 物理 節點 的選定實體的全局重心 。 重心呈深藍色。 \n \n \n “ \xa0 顯示浮力中心” 使您可以顯示或隱藏具有非NULL \xa0 物理 節點 的選定實體的整體浮力中心 。 浮力中心以紫色渲染。 \n \n \n 使用 顯示支撐多邊形， 可以顯示或隱藏具有非NULL \xa0 物理 節點 的選定實體的支撐多邊形 。 所謂支撐多邊形，是指實體的接觸點的凸包在水平平面上的投影，該平麵包含最低的多邊形。 此外，如果質心在後面的平面中的投影位於支撐多邊形內（靜態平衡），則呈綠色，否則呈紅色。 此渲染選項僅可用於頂部沒有其他實體的實體。 \n \n \n \n \n 如果 啟用 了“ \xa0 禁用選擇” 選項，則它會阻止您在單擊3D窗口時更改所選的實體節點。 當您要更改視點而不修改場景樹中的可見字段和選定字段時，這在建模階段特別有用。 \n \n \n 如果 啟用 了“ \xa0 鎖定視點” 選項，則可以阻止您 在3D窗口上拖動鼠標或移動鼠標滾輪時 更改“ \xa0 視點” 節點 的位置和方向 。 當您不想意外更改視點的位置和方向時，此功能特別有用。 \n \n \n \n \n 模擬菜單 \n \n 該 模擬 菜單用於控制模擬模式。 \n \n \n 在 暫停 菜單項（和按鈕）暫停仿真。 \n \n \n “ \xa0 步驟” 菜單項（和按鈕）執行模擬的一個基本時間步。 該步驟的持續時間 在 WorldInfo 節點 的 basicTimeStep 字段中 定義 ，可以在場景樹窗口中進行調整以滿足您的需求。 \n \n \n 該 實時 菜單項（和按鈕），直到它被中斷運行在實時仿真 Pause 或 Step 。 在運行模式下，場景的3D顯示每 n個 基本時間步 刷新一次 ，其中 n displayRefresh 在 WorldInfo 節點 的 字段中 定義 。 \n \n \n “ \xa0 運行” 菜單項（和按鈕）類似於 Real-time ，除了它運行得盡可能快。 \n \n \n 的 快速 菜單項目（和按鈕）是一樣 Run ，不同的是沒有圖形渲染被執行。 由於禁用了圖形渲染（黑屏），因此可以加快仿真速度，因此非常適合CPU密集型仿真（遺傳算法，視覺，學習等）。 \n 構建菜單 \n 在生成菜單提供的功能，以編譯（或交叉編譯）控制器的代碼。 此處 將更詳細地描述構建菜單。\xa0\n 疊加菜單 \n \n \n 覆蓋” 菜單提供特定於渲染設備覆蓋的操作（“ \xa0 相機” ，“ \xa0 顯示” ，“” \xa0 Rangefinder ）。僅當在3D窗口中選擇了機械手或模擬中只有一個機械手時，此菜單的某些操作才有效： \n \n \n “ \xa0 攝像機設備” 子菜單包含所選機器人及其後代機器人的所有攝像機設備的列表，並允許用戶通過選中或取消選中相應項目來顯示或隱藏單個攝像機覆蓋圖像。 相機覆蓋層與顯示覆蓋層不同，因為它們具有洋紅色邊框。 請注意，如果 Hide All Camera Overlays 選中 該 項目，則與 Camera Devices 菜單項 的狀態無關，攝像頭設備的疊加層在3D視圖中將不可見 。 一 Camera Devices ，如果在外部窗口通過雙擊它顯示的疊加層的紋理菜單項將被禁用。 \n \n \n 所述 測距儀設備 子菜單包含所有選定的機器人的測距儀設備和其後代機器人的列表，並讓用戶顯示或隱藏由選中或取消選中相應的項的單測距儀的疊加圖像。 測距儀疊加層與照相機疊加層不同，因為它們具有黃色邊框。 請注意，如果 Hide All RangeFinder Overlays 選中 該 項目，則與 RangeFinder Devices 菜單項 的狀態無關，在3D視圖中將不會顯示測距儀設備覆蓋圖 。 一 RangeFinder Devices ，如果在外部窗口通過雙擊它顯示的疊加層的紋理菜單項將被禁用。 \n \n \n 所述 顯示設備 的子菜單包含所選機器人的所有的顯示設備和其後代機器人的列表，並讓通過檢查或取消選中相應的項目的用戶顯示或隱藏單個顯示疊加圖像。 顯示覆蓋圖與相機覆蓋圖不同，因為其青色邊框。 請注意，如果 Hide All Display Overlays 選中 該 項目，則顯示設備覆蓋圖在3D視圖中將不可見，而與 Display Devices 菜單項 的狀態無關 。 一 Display Devices ，如果在外部窗口通過雙擊它顯示的疊加層的紋理菜單項將被禁用。 \n \n \n 另一方面，以下各項始終處於活動狀態，並適用於世界上所有的機器人： \n \n \n “ \xa0 隱藏所有攝像機覆蓋物” 選項可獨立於 Camera Devices 子菜單中 設置的特定機器人設備選項，在3D視圖中隱藏所有攝像機設備覆蓋物 。 \n \n \n “ \xa0 隱藏所有RangeFinder疊加層” 選項獨立於 RangeFinder Devices 子菜單中 設置的特定機器人的設備選項，在3D視圖中隱藏所有相機設備的疊加層 。 \n \n \n “ \xa0 隱藏所有顯示覆蓋圖” 選項可獨立於 Display Devices 子菜單中 設置的特定機器人的設備選項，隱藏3D視圖中的所有顯示設備覆蓋圖 。 \n 工具菜單 \n \n 在 工具 菜單可以打開各種Webots窗口。 \n \n \n 在 3D視圖 菜單項顯示或隱藏3D窗口，並允許您與3D模擬互動。 \n \n \n 該 場景樹 菜單項打開 Scene Tree ，可以在其中編輯虛擬世界的窗口。 或者，也可以雙擊主窗口中的某些對象：這將自動打開“場景樹”，並選擇相應的對象。 \n \n \n 在 文本編輯器 菜單項打開Webots文本編輯器。 該編輯器可用於編輯和編譯控制器源代碼。 \n \n \n “ \xa0 控制台” 菜單項將打開“ Webots控制台”，這是一個只讀控制台，用於顯示Webots錯誤消息和控制器輸出。 \n \n \n “ \xa0 文檔” 菜單項顯示或隱藏脫機“ Webots”文檔窗口。 \n \n \n “ \xa0 還原佈局” 菜單項可還原主窗口面板的出廠佈局。 \n \n \n 該 清除控制台 菜單項清除控制台。 \n \n \n “ \xa0 編輯物理插件” 菜單項將在文本編輯器中打開 物理插件 的源代碼。 \n \n \n “ \xa0 首選項” 項將彈出 本節中 描述的窗口 。 \n 嚮導菜單 \n \n 該 嚮導 菜單可以更容易地創建新的項目和新的控制器。 \n \n \n “ \xa0 新建項目目錄...” 菜單項首先提示您選擇文件系統位置，然後創建一個項目目錄。 項目目錄包含幾個子目錄，這些子目錄用於存儲與特定Webots項目相關的文件，即世界文件，控制器文件，數據文件，插件等。Webots會記住當前項目目錄，並自動從中打開並保存任何類型的文件。當前項目目錄的相應子目錄。 \n \n \n “ \xa0 New Robot Controller ...” 菜單項允許您創建新的控制器程序。 首先將提示您在C，C ++，Java，Python或 MATLAB \xa0 TM 控制器 之間進行選擇 。 如果您在Windows上選擇C或C ++，Webots將為您提供創建Makefile / gcc項目或Visual Studio項目的可能性。 然後，Webots將要求您輸入控制器的名稱，最後它將在當前項目目錄中創建所有必需的文件（包括模板源代碼文件）。 \n \n \n “ \xa0 新建物理插件...” 菜單項將使您可以為項目創建新的物理插件。 Webots要求您選擇一種編程語言（C或C ++）和新的物理插件的名稱。 然後，它將在當前項目中創建目錄，模板源代碼文件和Makefile。 \n 幫助菜單 \n \n 使用“ \xa0 幫助” 菜單可以更輕鬆地訪問文檔，支持和常規信息。 \n \n \n “ \xa0 關於...” 項將打開一個 About... 顯示許可證信息 的 窗口。 \n \n \n “ \xa0 Webots導覽...” 菜單項啟動了一個導覽，通過一系列示例演示Webots的功能。 \n \n \n “ \xa0 檢查更新...” 項會彈出一個窗口，通知正在使用的Webots版本是否為最新版本，並在需要時提供下載最新版本的鏈接。 \n \n \n 在 OpenGL的信息... 菜單項，為您提供有關當前OpenGL硬件和驅動程序的信息。 它可以用於診斷渲染問題。 \n \n \n 其餘菜單項以HTML頁面，PDF文檔等形式顯示各種信息。 \n 主工具欄 \n \n 主工具欄包含用於添加新節點對世界的按鈕，速度表（見本 節 ）和快捷方式的項目 File ， Simulation 和 View 菜單。 \n \n \n \xa0 隱藏/顯示場景樹 ：顯示或隱藏場景樹，並因此調整3D窗口的大小。 \n \n \n \xa0 添加 ：添加節點或對象。 對於節點，這會觸發一個對話框，使您可以從列表中選擇節點類型。 將使用默認值創建新節點，之後可以對其進行修改。 您只能插入適合相應字段的節點。 該對話框還可以通過單擊 導入... 按鈕 來加載先前導出的節點 。 有關如何導出節點的更多信息，請參見 此處 。 \n 車速表和虛擬時間 \n 速度計（請參見下 圖 ）指示計算機上模擬的速度。它顯示在主工具欄上，並指示仿真與實時相比運行的速度。換句話說，它代表虛擬時間的速度。如果速度計的值為2，則意味著您的計算機仿真的運行速度是相應真實機器人的兩倍。此信息在 Run 模式和 Fast 模式下均有效。注意：在逐步模式下運行模擬時，不會顯示模擬速度（ N/A 而是顯示) \n \n 在速度表的左側，使用以下格式顯示 虛擬時間 ： \n \n 其中 H 是小時數（可以是幾位數字）， MM 是分鐘數， SS 是秒數， MMM 是毫秒數（請參見此 圖 ）。如果車速表的值大於1，則虛擬時間的進度要快於實時時間。 \n 可以 在場景樹窗口 basicTimeStep 的 WorldInfo 節點 的 字段中 設置模擬的基本時間步長 。 它以虛擬時間毫秒錶示。 該時間步長的值定義了在 Step 模式 期間執行的時間步長 。 此步驟乘以 displayRefresh 同一 WorldInfo 節點 的 字段， 以定義刷新顯示的頻率。 \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': '用戶介面.html'}, {'title': 'Assignment 1', 'text': '', 'tags': '', 'url': 'Assignment 1.html'}, {'title': 'python 亂數分組', 'text': '\n \n 亂數分組名單 \n \n \n 影片 \n \n 參考資料 \n https://kk665403.pixnet.net/blog/post/403974404-%5Bpython%5D-python-ramdom%E9%9A%A8%E6%A9%9F%E4%BA%82%E6%95%B8%E7%B0%A1%E6%98%93%E7%94%A8%E6%B3%95?fbclid=IwAR05Kjm0u7LIJWtpdQrwENl1oUDM7uCW2tyVuki-TgGYtXhupVlsu2W52t4 \n', 'tags': '', 'url': 'python 亂數分組.html'}, {'title': '報告', 'text': 'https://s5.aconvert.com/convert/p3r68-cdx67/ren7r-cyl88.pdf \n 影片簡單介紹 \n \n', 'tags': '', 'url': '報告.html'}, {'title': '直播每週影片', 'text': '', 'tags': '', 'url': '直播每週影片.html'}, {'title': 'w2', 'text': '分配工作流程表 \n \n 直播會議影片 \n \n \n', 'tags': '', 'url': 'w2.html'}, {'title': 'w3', 'text': '會議影片 \n \n \n 會議內容 \n 主要講解python亂數分組程式,以及跟各個細分組長說明接下來必須同時對小組網站進行協同,小組長必須以pull request的方式將改版網站給組長,組長在選擇merge,解決可能合併會產生的問題 \n', 'tags': '', 'url': 'w3.html'}, {'title': 'w5', 'text': '\n 開會內容 \n \n webots tutorial 分配 \n \n \n 主要核心 \n 希望大家能夠摸熟coppelias及webots,並且練習onshape繪圖,充分利用onshape之好處,對於協同者是相當有利的一件事! \n', 'tags': '', 'url': 'w5.html'}, {'title': 'w6', 'text': '\n 開會內容 \n 1.webots tutorial分配到的趕快完成 2.每個人都須安裝OBS,之後拍影片右下角要有自己的頭像 3.請大家這段時間自行學習Coppeliasim,之後要用這套軟體模擬 4.請安裝pyslvs,並且學習這套軟體,之後要在四輪車上加上提球機構 ,需要彼此討論機構設計,去進行模擬 5.TOP0及TOP1的文章,記得有時間可以去看一下 6.Handout meet線上上課說明 \n 主要核心 \n 1.希望大家摸熟coppeliasim這套物理引擎模擬軟體,目前希望能讓車子加上馬達運動,往後加上python編成程式控制,控制四輪車的運動路徑,並且模擬物理環境 \n 2.也請大家安裝pyslvs這套軟體,並且了解這套軟體的操作,對於往後在四輪車上加上提球機構設計,有更大的幫助. \n', 'tags': '', 'url': 'w6.html'}, {'title': '課程內容', 'text': '1.需安裝OBSPortable.exe與yotube做配合,往後拍影片,頭像左下角需要有自己的影像 \n 2.安裝pyslvs.exe,進行四連趕模擬,觀察連桿運動路徑 \n \n', 'tags': '', 'url': '課程內容.html'}, {'title': 'w7', 'text': '', 'tags': '', 'url': 'w7.html'}, {'title': '說明線上課程及流程', 'text': '\n 開會內容 \n 1.說明線上課程 2.每組的組員一定要會使用obs+youtube,將影片URL遷入個人網站及分組網站 3.每組的組員一定都要跟組長一起與老師用Handout Meet參加會議,並且了解分配的任務,然後組長在另外開會議進行任務分配,並且說明該週目標', 'tags': '', 'url': '說明線上課程及流程.html'}]};